import React from "react";
import Home from "./components/Home";
import "bootstrap/dist/css/bootstrap.css";
import "font-awesome/css/font-awesome.css";
import "./App.css";
import Menu from "./components/Menu";

function App() {
  return (
    <React.Fragment>
      <Menu />
      <Home />
    </React.Fragment>
  );
}

export default App;
